import React, {useState, useEffect} from 'react';
import Loading from "./loading.js";


const Loader = () => {
    const [loading, setIsLoading] = useState(true);

    useEffect(() => {
        setTimeout(() => {
            setIsLoading(false);
        }, 2000);
    }, []);

    if(loading) {
        return <Loading />;
    }

    return (
        <div>
            <h1> Login succesful! </h1>
        </div>
    )


}

export default Loader;
